import React, { Component } from 'react'
import Input from './Input'

export class FocusInput extends Component {
    constructor(props) {
        super(props)
    
       this.Ref=React.createRef()
    }
    
    render() {
        return (
            <div>
              <Input ref={this.Ref}></Input>
              <input type="text"></input>
            </div>
        )
    }
}

export default FocusInput
